import React from 'react';
import { Link } from 'react-router-dom';
import './NavMenu.css';
import { useAuth0 } from '@auth0/auth0-react';
import { Col, Row, Button, Offcanvas, Form, NavDropdown, Nav, Navbar, Stack, Image, Container } from 'react-bootstrap';

const NavMenuNew = () => {
    const { loginWithRedirect, logout } = useAuth0();
    const Authenticated = useAuth0().isAuthenticated;
    const Loading = useAuth0().isLoading;

    const loginButton = () => {
        if (Loading === true && Authenticated === false) {
            return (
                <Nav.Link className="text-dark" onClick={() => loginWithRedirect()}>Login</Nav.Link>
            )
        }
        if (Authenticated === true && Loading === false) {
            return (
                null
            )
        }
        if (Authenticated === false && Loading === false) {
            return (
                <Nav.Link className="text-dark" onClick={() => loginWithRedirect()}>Login</Nav.Link>
            )
        }
    }
    const logoutButton = () => {
        if (Loading === true && Authenticated === false) {
            return (
                null
            )
        }
        if (Authenticated === true && Loading === false) {
            return (
                <Nav.Link className="text-dark" onClick={() => logout()}>Logout</Nav.Link>
            )
        }
        if (Authenticated === false && Loading === false) {
            return (
                null
            )
        }
    }
    const profileButton = () => {
        if (Loading === true && Authenticated === false) {
            return (
                null
            )
        }
        if (Authenticated === true && Loading === false) {
            return (
                <Nav.Link as={Link} className="text-dark" to="/Profile">Profile</Nav.Link>
            )
        }
        if (Authenticated === false && Loading === false) {
            return (
                null
            )
        }
    }


    return (
        <header>

            {['lg'].map((expand) => (
                <Navbar key={expand} expand={expand} className="mb-3 navbar-size">
                    <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
                    <Navbar.Offcanvas
                        id={`offcanvasNavbar-expand-${expand}`}
                        aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
                        placement="end">
                        <Offcanvas.Header closeButton>
                            <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                                North End Records
                            </Offcanvas.Title>
                        </Offcanvas.Header>
                        <Offcanvas.Body>
                            <Stack gap={12} className='col-md-5 mx-auto'>
                                <Nav className="justify-content-center flex-grow-1 pe-3 nav1">
                                    <Container fluid>
                                        <Row>
                                    <Col lg='2'>
                                        <img src='https://i.imgur.com/lOltIEw.jpeg' style={{height: "100px"}}/>
                                    </Col>
                                    <Col lg='3'>
                                        <Stack direction='horizontal' gap={3} style={{ width: "25%", 'align-self': "center" }}>
                                            <Form.Control type="input" placeholder="Search" />
                                            <Button variant="search" type="submit">
                                                Search
                                            </Button>
                                        </Stack>
                                    </Col>
                                    </Row>
                                    </Container>

                                </Nav>
                                <Nav className="justify-content-center flex-grow-1 pe-3 nav2">
                                    <Nav.Item>
                                        <Nav.Link as={Link} className="text-dark" to="/" >Home</Nav.Link>
                                    </Nav.Item>
                                    <Nav.Item>
                                        <Nav.Link as={Link} className="text-dark" to="/ProductList">ProductList</Nav.Link>
                                    </Nav.Item>
                                    <Nav.Item>
                                        <Nav.Link as={Link} className="text-dark" to="/Details">Details</Nav.Link>
                                    </Nav.Item>
                                    <Nav.Item>
                                        {profileButton()}
                                    </Nav.Item>
                                    <Nav.Item>
                                        {loginButton()}
                                    </Nav.Item>
                                    <Nav.Item>
                                        {logoutButton()}
                                    </Nav.Item>
                                    <NavDropdown
                                        title="Dropdown"
                                        id={`offcanvasNavbarDropdown-expand-${expand}`}
                                    >
                                        <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                                        <NavDropdown.Item href="#action4">
                                            Another action
                                        </NavDropdown.Item>
                                        <NavDropdown.Divider />
                                        <NavDropdown.Item href="#action5">
                                            Something else here
                                        </NavDropdown.Item>
                                    </NavDropdown>
                                </Nav>
                            </Stack>
                        </Offcanvas.Body>
                    </Navbar.Offcanvas>

                </Navbar>
            ))}
        </header>
    )
}

export default NavMenuNew
